import './PlayOptions.css'

function PlayOptions() {
    return (
        <div className="PlayOptions">
            <div className='PlayOption'>flip</div>
            <div className='PlayOption'>create private room</div>
            <div className='PlayOption'>join private room</div>
        </div>
    );
};

export default PlayOptions;
